import React, { Component } from "react";
import Counter from "./Counter";
import { CardGroup, Card, Button, Row, Col, Container } from "react-bootstrap";
import img from "../../src/Krish.png";

class Counters extends Component {
  render() {
    let cardRender = this.props.counters.map((counter) => (
      <CardGroup>
        <Card>
          <Card.Title>Card 1</Card.Title>
          <Card.Img
            variant="top"
            style={{ height: 250, width: 250 }}
            src={img}
          />
          <Card.Body>
            <Button variant="primary">Increment</Button>
            <Button variant="primary">Decrement</Button>
            <Card.Text>
              This is a wider card with supporting text below as a natural
              lead-in to additional content. This content is a little bit
              longer.
            </Card.Text>
          </Card.Body>
          <Card.Footer>
            <small className="text-muted">Last updated 3 mins ago</small>
          </Card.Footer>
        </Card>
        <Card>
          <Card.Img
            variant="top"
            style={{ height: 250, width: 250 }}
            src={img}
          />
          <Card.Body>
            <Card.Title>Card title</Card.Title>
            <Card.Text>
              This card has supporting text below as a natural lead-in to
              additional content.{" "}
            </Card.Text>
          </Card.Body>
          <Card.Footer>
            <small className="text-muted">Last updated 3 mins ago</small>
          </Card.Footer>
        </Card>
        <Card>
          <Card.Img
            variant="top"
            style={{ height: 250, width: 250 }}
            src={img}
          />
          <Card.Body>
            <Card.Title>Card title</Card.Title>
            <Card.Text>
              This is a wider card with supporting text below as a natural
              lead-in to additional content. This card has even longer content
              than the first to show that equal height action.
            </Card.Text>
          </Card.Body>
          <Card.Footer>
            <small className="text-muted">Last updated 3 mins ago</small>
          </Card.Footer>
        </Card>
      </CardGroup>
      // <Card
      //   style={{ width: "18rem" }}
      //   // style={{ width: "18rem", display: "flex", flexDirection: "row" }}
      //   key={counter.id}
      // >
      //   <Card.Title style={{ display: "flex" }}>Proile 1</Card.Title>
      //   <Card.Img variant="top" style={{ height: 250, width: 250 }} src={img} />
      //   <Card.Body style={{ flex: 1 }}>
      //     <Button variant="primary">Increment</Button>
      //     <Button variant="primary">Decrement</Button>
      //     <Card.Text>Score</Card.Text>
      //   </Card.Body>
      // </Card>
      // <Row key={counter.id}>
      //   <Col sm="6">
      //     <Counter
      //       onIncrement={this.props.onIncrement}
      //       onDecrement={this.props.onDecrement}
      //       counter={counter}
      //     />
      //   </Col>
      // </Row>
    ));
    return <Container>{cardRender}</Container>;
  }
}

export default Counters;
